  color: #E1C99B;
  font-style: normal;
}
h2 {
  font-size: 2rem;
}
h1 {
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  font-weight: 600;
  font-size: 3rem;
  line-height: 3rem;
}
.underline {
  padding-bottom: 1rem;
  border-bottom: 2px solid white;
}
h4 {
  margin-bottom: 4px;
  font-weight: bold;
}
ul {
  margin-top: 4px;
}
.title-page h1 {
  margin: 0;
  padding: 30vh 0;
  font-size: clamp(3rem, 16vw, 12rem);
  font-weight: bold;
  letter-spacing: 1px;
}

.justify-right-parent {
  display: flex;
  flex-direction: column;
  align-items: end;
}
.right-align-text {
  text-align: end;
}

/* general full screen */
.fullscreen {
  display: none;
}
@media (min-width: 800px) {
  .fullscreen {
    display: block;
  }
  .mobile-only {
    display: none;
  }
}


/* links */
a {
  text-decoration: none;
  color: white;
  font-size: clamp(1rem, 3vw, 1.2rem);
  transition: all 0.4s ease-out;
}
a:hover {
  color: black;
  background: white;
  font-weight: bold;
}
.capsule-button {
  padding: 6px 1rem;
  border: 3px solid white;
  border-radius: 500px;
  margin: 5px 5px;
  display: block;
  width: fit-content;
}

/* general shapes */
.circle {
  border-radius: 50%;
  background: white;
  width: 60%;
  display: flex;
}
.image-in-circle {
  width: 96%;
  padding: 2%;
  border-radius: 50%;
}
.black-rectangle {
  background: black;
  padding: 1rem 2rem;
  margin: 4rem 1rem;
  z-index: 2;
}
.center-parent {
  display: flex;
  justify-content: center;
}
.center-text {
  text-align: center;
}
.image-with-description {
  overflow: hidden;
  position: relative;
  max-width: 20rem;
  margin-bottom: 0.5rem;
}
.image-with-description img {
  position: absolute;
  left: calc(50% - 10rem);
  max-width: 20rem;
  bottom: 0;
}
.image-with-description div {
  position: relative;
  height: 100%;
  min-height: 10rem;
}
.image-with-description p {
  padding: 1rem;
  padding-bottom: 0.5rem;
  margin: 0;
  background: rgba(0, 0, 0, 0.35);
  filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
}
.hover-effect:hover p {
  background: none;
  filter: none;
}
.hover-effect {
  background: linear-gradient(white 0 0) var(--p, 0) / var(--p, 0) no-repeat;
  transition: .4s, background-position 0s;
}
.hover-effect:hover {
  color: black;
  --p: 100%;
}

.navbar {
  height: 47px;
  width: 100%;
  background-color: white;
  filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
  display: flex;
  justify-content: space-between;
  position: fixed;
  top: 0;
  z-index: 100;
}
.navbar-icon {
  height: 35px;
  padding-top: 6px;
  padding-left: 1rem;
  padding-right: 1rem;
}
/* navbar fullscreen display */
#navbar-fullscreen-links {
  display: none;
  z-index: 99;
  align-items: center;
}
#navbar-fullscreen-links a {
  padding: 12px 28px;
  color: black;
  background-color: white;
  font-weight: 900;
  transition: background-color 0.4s ease-out;
}
#navbar-fullscreen-links a:hover {
  color: white;
  background-color: #333;
}
@media (min-width: 600px) {
  .navbar-burger {
    display: none;
  }
  #navbar-fullscreen-links {
    display: flex;
  }
}
.navbar a:hover {
  background: white;
}
/* mobile navbar */
#navbar-links {
  display: none;
  flex-direction: column;
  position: fixed;
  top: 47px;
  z-index: 99;
  background: black;
  width: 100%;
}
#navbar-links a {
  padding: 12px 28px;
  text-align: right;
}


/* start */
.start {
  background: #3B4F6C;
  padding-bottom: 5rem;
}
.spacer {
  height: 6rem;
}
.spacer-mini {
  height: 1rem;
}
.start-spacer-v2 {
  height: calc(20vw - 2rem);
}
#start-pic-parent {
  position: relative;
}
#start-pic {
  position: absolute;
  left: calc(20%)
}
#start-name-intro {
  padding-top: 31vw;
}
#arrow-in-circle {
  padding: 2rem;
}
/* start full screen */
@media (min-width: 800px) {
  .start {
    height: 100vh;
  }  
  #start-pic-parent {
    position: absolute;
    width: 100vw;
    top: 0;
  }
  #start-pic {
    position: relative;
    left: 56vw;
    width: 55vh;
    top: 20vh;
  }
  #start-name-intro {
    display: none;
  }
  #start-fullscreen-intro {
    position: relative;
    top: clamp(55vh, 35vw, 75vh);
    left: 10vw;
  }
  .start-spacer-v2 {
    display: none;
  }  
  #arrow-in-circle {
    position: absolute;
    bottom: 1rem;
    left: calc(50vw - 4rem);
  }
}


/* education */
.education {
  padding-top: 2rem;
  padding-bottom: 10rem;
  background-image: linear-gradient(#3B4F6C, #6C3B3B);
}
.quote {
  margin: 2rem;
  line-height: 36px;
  letter-spacing: 0.25px;
}
.education a:hover {
  color: #3B4F6C;
}
/* education fullscreen */
@media (min-width: 800px) {
  .education {
    padding-left: 10vw;
    padding-right: 10vw;
    display: flex;
    flex-direction: row-reverse;
    justify-content: space-between;
  }
  .quote-section {
    width: min(400px, 40vw);
    padding-top: 2rem;
    padding-left: 2rem;
  }
  .quote-section .link-section {
    display: grid;
    justify-items: center;
  }
  .education .black-rectangle {
    width: min(50vw, 450px);
    margin: 0;
    padding-bottom: 2rem;
  }
}
@media (min-width: 1150px) {
  .quote-section {
    padding-top: 10rem;
  }
  .quote-section .link-section {
    display: flex;
  }
}

