.projects-title {
  background-color: #6C3B3B;;
}
.projects {
  padding-top: 2rem;
  padding-bottom: 10rem;
  background-image: linear-gradient(#6C3B3B, #3B6C69);
}
.projects h1 {
  font-size: 2.5rem;
  line-height: 45px;
}
.project img {
  display: none;
  border: 5px solid white;
}
.projects .image-with-description {
  display: block;
  margin: 0;
}
.project-gallery {
  display: grid;
  grid-template-columns: auto auto;
  gap: 0.5rem;
}
@media (min-width: 800px) {
  .projects .black-rectangle {
    margin-left: 10vw;
    margin-right: 10vw;
  }
}
@media (min-width: 980px) {
  .project {
    position: relative;
    min-height: 36rem;
  }
  .project .black-rectangle {
    position: absolute;
    margin: 0 10vw;
    width: 400px;
  }
  .project img {
    display: block;
    width: 30vw;
    position: absolute;
    top: 2rem;
    right: 10vw;
    z-index: 1;
  }
